export default class Vector {
    x: number;
    y: number;
    constructor(x: number, y: number);
    readonly w: number;
    readonly h: number;
    angleTo(other: Vector): number;
    distanceTo(other: Vector): number;
    midpoint(other: Vector): Vector;
    equals(other: Vector): boolean;
    toPol(): Vector;
    readonly m: number;
    readonly m2: number;
    add(v: Vector): Vector;
    sub(v: Vector): Vector;
    dot(v: Vector): Vector;
    smul(c: number): Vector;
    norm(): Vector;
    toString(separator: string): string;
}
